import bgHome from "../../images/bgHome.jpeg";
import Line from "./separation/separation"
import "./home.css"

function home () {
    return(
        <div className="home">
            <img src={bgHome} alt=""/>
            <div className="content">
                <Line/>
                <h1>FULL STACK<br/>DVELOPER</h1>
            </div>
        </div>
    )
};
export default home
